import { LitElement, css, html } from "lit"
import { customElement, property } from "lit/decorators.js"

@customElement("doc-proof")
export class DocProof extends LitElement {
	static override styles = css`
		.social-proof {
			display: flex;
			flex-direction: row;
			justify-content: flex-start;
			align-items: center;
			flex-wrap: wrap;
			gap: 1rem;
			width: 100%;
			color: #475569;
		}

		@media screen and (max-width: 768px) {
			.social-proof {
				flex-direction: column;
				align-items: center;
			}
		}
	`

	@property()
	organisations: string = ""

	override render() {
		return html`<div class="social-proof">
			${this.organisations.includes("calcom") ? html`<calcom-logo></calcom-logo>` : ``}
			${this.organisations.includes("appflowy") ? html`<appflowy-logo></appflowy-logo>` : ``}
			${this.organisations.includes("listmonk") ? html`<listmonk-logo></listmonk-logo>` : ``}
			${this.organisations.includes("openassistant")
				? html`<openassistant-logo></openassistant-logo>`
				: ``}
			${this.organisations.includes("jitsi") ? html`<jitsi-logo></jitsi-logo>` : ``}
			${this.organisations.includes("osmosis") ? html`<osmosis-logo></osmosis-logo>` : ``}
			${this.organisations.includes("pokemonautochess")
				? html`<pokemonautochess-logo></pokemonautochess-logo>`
				: ``}
			${this.organisations.includes("frigate") ? html`<frigate-logo></frigate-logo>` : ``}
			${this.organisations.includes("remnote") ? html`<remnote-logo></remnote-logo>` : ``}
		</div>`
	}
}

